import React from 'react';
import { FormGroup, InputPrice } from '../../components/Form';
import Link from 'next/link';
import useConfigQuery from '../../src/customHooks/useConfigQuery';

export interface ProductState {
  data: any;
  loading: any;
}

export interface ProductProps {}

const Product: React.SFC<ProductProps> = () => {
  const { loading, data } = useConfigQuery<ProductState>();
  console.log(data);
  console.log(loading);

  if (loading) return 'Loading...';

  return (
    <div className="col pt-5">
      <div className="container">
        <Link href="/dashboard/products">
          <div style={{ cursor: 'pointer' }}>
            <svg
              className="bi bi-arrow-left-short"
              width="25px"
              height="25px"
              viewBox="0 0 16 16"
              fill="currentColor"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                fillRule="evenodd"
                d="M7.854 4.646a.5.5 0 010 .708L5.207 8l2.647 2.646a.5.5 0 01-.708.708l-3-3a.5.5 0 010-.708l3-3a.5.5 0 01.708 0z"
                clipRule="evenodd"
              />
              <path
                fillRule="evenodd"
                d="M4.5 8a.5.5 0 01.5-.5h6.5a.5.5 0 010 1H5a.5.5 0 01-.5-.5z"
                clipRule="evenodd"
              />
            </svg>
            Products
          </div>
        </Link>
        <h3 className="mb-0">Product</h3>
        <h2>{loading ? 'No Data Yet' : data.getGlobalConfig.businessName}</h2>
        <h2>{loading ? 'No Data Yet' : data.getGlobalConfig.fullName}</h2>
        <FormGroup>
          <InputPrice
            onChange={() => console.log('Event')}
            labelTitle="Name"
            price="2"
          />
        </FormGroup>
      </div>
    </div>
  );
};

export default Product;
